var app=angular.module("builtInApp",[]),adjArray=[],nounArray=[];app.controller("MainController",["$scope","$http",function(a,b){function c(a,b){return Math.floor(Math.random()*(1+b-a)+a)}a.getWords=function(){b.get("/getNouns").then(function(a){for(i=0;i<a.data.nouns.length;i++)nounArray.push(a.data.nouns[c(0,a.data.nouns.length-1)])}),a.nouns=nounArray,b.get("/getAdj").then(function(a){for(i=0;i<a.data.adjectives.length;i++)adjArray.push(a.data.adjectives[c(0,a.data.adjectives.length-1)])}),a.adjectives=adjArray}}]);